script: |
  super -f text -I q8485.spq | sort > q8485.out

inputs:
  - name: q8485.spq
    data: |
      SELECT DISTINCT - 60 + 9 - + cor0.col1 FROM tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0, tab2 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q8485.out
    data: |
      -61
      -64
      -77
